import "./App.css";
import HomePage from "./Homepage/Homepage";
import Navbar from "./Components/Navbar/Navbar";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import Monday from "../src/Pages/Monday";

function App() {
  if (URL === "/monday") {
    <div>Monday</div>;
  }
  return (
    <div className="App">
      <Navbar></Navbar>;
    </div>
  );
}

export default App;
